def find_min_time(i, j, t):
    try:
        if i == j:
            return 0
        elif i + 1 == j:
            return t[i][j]
        min_time = t[i][j]
        for k in range(i + 1, j):
            min_time = min(min_time, find_min_time(i, k, t) + find_min_time(k, j, t))            
        return min_time
    except IndexError:
        return None

